    function switchSheet(sheetNum) {
        document.querySelectorAll(".sheet").forEach(s => s.classList.remove("active"));
        document.getElementById("sheet" + sheetNum).classList.add("active");
    }

    function buildTable(selector, data, options) {
        const columns = Object.keys(data[0] || {}).map(key => {
            return {
                title: key.replace(/_/g, ' '),
                data: key,
                visible: (options.hiddenCols || []).indexOf(key) === -1
            };
        });

        const thead = document.querySelector(selector + ' thead tr');
        const tfoot = document.querySelector(selector + ' tfoot tr');
        thead.innerHTML = '';
        tfoot.innerHTML = '';
        columns.forEach(col => {
            thead.innerHTML += `<th>${col.title}</th>`;
            tfoot.innerHTML += `<th>${col.title}</th>`;
        });

        $(selector).DataTable({
            data: data,
            columns: columns,
            order: options.order || [],
            pageLength: 10,
            lengthMenu: [10, 25, 50, 100],
            responsive: true,
            destroy: true,
            initComplete: function () {
                this.api().columns().every(function () {
                    var column = this;
                    var select = $('<select><option value=""></option></select>')
                        .appendTo($(column.footer()).empty())
                        .on('change', function () {
                            var val = $.fn.dataTable.util.escapeRegex($(this).val());
                            column.search(val ? '^' + val + '$' : '', true, false).draw();
                        });
                    column.data().unique().sort().each(function (d, j) {
                        select.append('<option value="' + d + '">' + d + '</option>');
                    });
                });
            }
        });
    }

    $(document).ready(function () {
        buildTable("#table1", data1, {
            hiddenCols: ["wettbewerb_id"],
            order: [[0, "desc"], [1, "asc"]]
        });
        buildTable("#table2", data2, {
            order: [[data2[0] ? Object.keys(data2[0]).length - 1 : 0, "desc"]]
        });
    });
</script>
